import React from 'react';

const Form = ({searchField, setSearchField, setPlayer}) => (
  <form onSubmit={e => {
    e.preventDefault();
    e.setPlayer(searchField);
  }}>
    <input 
    type="text"
    value={searchField}
    
    />
    <button>Submit</button>
  </form>
)

export default Form;
